import logo from './Images/Logo.jpg';
import Nav from './components/Nav';
import Home from './components/Home';

function App() {
  return (
    <div>
      <div className='text-center'>
        <img src={logo} className='home-logo img-fluid' alt="Image" />
      </div>

      <div>
        <Nav />
      </div>

      <div>
        <Home />
      </div>

    </div>
  );
}

export default App;
